use data::{generate_xor_data, train_val_split, create_batches}; fn main() { println!("=== Entrenar Training Example: XOR Problem ===\n"); // Hyperparameters let input_dim = 2; let hidden_dim = 8; let output_dim = 1; let learning_rate = 0.01; let batch_size = 32; let n_epochs = 100; let val_ratio = 0.2; let patience = 10; // Early stopping patience // Generate data let (x_data, y_data) = generate_xor_data(1000); let ((x_train, y_train), (x_val, y_val)) = train_val_split(x_data, y_data, val_ratio); println!("Dataset:"); println!(" Training samples: {}", x_train.len()); println!(" Validation samples: {}", x_val.len()); println!(); // Create model and optimizer let mut model = MLP::new(input_dim, hidden_dim, output_dim); let mut optimizer = Adam::default_params(learning_rate); // Early stopping tracker let mut best_val_loss = f32::INFINITY; let mut patience_counter = 0; // Training loop for epoch in 0..n_epochs { // Training phase let train_batches = create_batches(&x_train, &y_train, batch_size); let mut train_loss = 0.0; for (batch_x, batch_y) in &train_batches { // Forward pass let y_pred = model.forward( batch_x, input_dim, hidden_dim, output_dim, batch_x.data().len() / input_dim, ); // Binary cross-entropy loss let loss = binary_cross_entropy(&y_pred, batch_y); train_loss += loss.data()[0]; // Backward pass backward(&loss); // Update parameters optimizer.step(&mut model.parameters()); // Zero gradients model.zero_grad(); } train_loss /= train_batches.len() as f32; // Validation phase let val_batches = create_batches(&x_val, &y_val, batch_size); let mut val_loss = 0.0; for (batch_x, batch_y) in &val_batches { let y_pred = model.forward( batch_x, input_dim, hidden_dim, output_dim, batch_x.data().len() / input_dim, ); let loss = binary_cross_entropy(&y_pred, batch_y); val_loss += loss.data()[0]; } val_loss /= val_batches.len() as f32; // Early stopping check if val_loss < best_val_loss { best_val_loss = val_loss; patience_counter = 0; println!("Epoch {:3}: train_loss=