} /// Binary cross-entropy loss: -[y*log(p) + (1-y)*log(1-p)]
fn binary_cross_entropy(y_pred: &Tensor, y_true: &Tensor) -> Tensor { // Sigmoid activation let sigmoid = |x: f32| 1.0 / (1.0 + (-x).exp()); let pred_data: Vec<f32> = y_pred.data().iter().map(|&x| sigmoid(x)).collect(); let true_data = y_true.data(); let mut loss = 0.0; for (p, y) in pred_data.iter().zip(true_data.iter()) { let p_clamped = p.clamp(1e-7, 1.0 - 1e-7); // Numerical stability loss += -y * p_clamped.ln() - (1.0 - y) * (1.0 - p_clamped).ln(); } Tensor::from_vec(vec![loss / pred_data.len() as f32], false)
}

